replyComment:
@Tammie Heazlit You say used to, did you cut her out of your life? That is the best thing to do when possible, I do my best to help people heal from these kinds of people, but I have not been lucky in my personal life with them. My best friend was killed by his personality-disordered wife among other things. Someone married into my family who is very much like AH, she physically attacked me twice in a rage over some minor thing, & after seeing how she treated her babies (she was actually found unfit by the Navy &abused her husband/my relative, she constantly threatened to say he hit her & get him thrown out of the Navy with a dishonorable discharge, sound familiar?) I raised the babies for a couple of years until he got out of the military to raise them. She abandoned them & came back for the older one & now abandoned her again, which breaks my heart every day.
 This case has been very triggering for me, but I pray it will help men, because she has hurt female victims with her lies. I want SOME good to come out of this case. I hope people will begin to realize both genders can be abused. 
 I don't think AH should be allowed to have one! I think a person should have to have a mental eval to adopt a baby/child. No good can come of it. It could have been a staged thing, or perhaps her partner will raise the child, or maybe that's wishful thinking on my part. Much Love

@Makkerooni: Thank you. You make me feel glad to be communicating with someone who thinks in such a sensible way - because most of the others I've come across on here were not very nice or thoughtful at all. 
I suppose that when I talk on social media about my life, it often feels like I'm exposing myself to loads of strangers who will see it (some of who may be the wrong kind of people). Though I have no problem speaking my mind to my family and the people who are close to me, but they are well aquainted with the story by now. 

You do have a point, about how I managed to get through so much of the bad/terrible stuff in this way. Well I don't know - I am just this person who has very firm/strong beliefs and principles about not doing/consuming the "wrong" things to put things "right". I have never gone too far with alcohol and absolutely "never" would touch drugs - I'm even very careful with prescription meds and have only taken them when extremely necessary (like when I was in so much pain etc and couldn't deal with it). And yep, there has been some really horrendous/horrific stuff going on in my life (like you would hardly believe) but "somehow" I have stayed alive (I don't even know how). But I'm sure that if I'd added drugs/narcotics etc into the situation this would've only made things a damned sight "worse" - and so it's just not for me. And this is why I can say to others, who are experiencing difficulties, that there is never an excuse (not on this Earth) for taking/using drugs (or any bad/toxic substances) because I know this from my own life-experiences. I have never regarded myself as a strong person or heroine (very far from it) but have always viewed myself as just simply "me" and how I can best survive my situation. But if "I" (someone like me) can do it, then I'm sure absolutely "anyone" can. But with me, I don't believe it is down to anything to do with "strength", but more to do with basic common sense or something, idk. And then there is the case that I do not function the same as most other people. I am a completely different species altogether.

